window.bookSummaryJSON = "<p>I've lived in the shadows. </p> <p>Now I have the chance to escape from them and start over. </p> <p>My cousin and best friend sent me to Alaska to get away from my family. A fresh start. </p> <p>I should have known my past wouldn't let me go that easily. As I fight to overcome it, deadly secrets are revealed. I may not survive. </p> <p>Can I manage to be happy? Three infuriating men seem to think I can, even though I've rejected them. </p> <p>Will the shadows finally consume me? </p> <p><i>Emerging from the Dark </i>is a stand-alone paranormal reverse harem book in the Dark Shifters Universe. Contains M/M.</p>"; 
